  false,\n\t\"url\": null,\n\t\"notes\": \"The Global Forecast System (GFS) forecast
  precipitation data at 37.5km resolution is created at the NOAA Climate Prediction
  Center for the purpose of near real-time usage by the national and international
  relief agencies and the general public. The users of this data include the U.S.
  Geological Survey (USGS), the U.S. Agency for International Development (USAID),
  the Joint Agricultural Weather Facility (JAWF) and the national Meteorological Centers
  in Africa, Asia and South America. The data is disseminated in the binary format
  as well as in the form of shape and tiff files for use by the GIS community. This
  data has seven individual 24-hour accumulated precipitation amounts (in millimeters)
  corresponding to the seven forecast days and one for the grand total of accumulated
  7day total precipitation (in millimeters). Thus, the represented forecast fields
  have 8 Geotiff files and 8 shape files. All these files are zipped into a single
  file (per day).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
